event_object:
if storing a single event, instead of an event source, the event json can go here.  Example json object: {
  "start": "2021-10-24T12:34",
  "title": "Virginia Climate Action",
  "allDay": false,
  "extendedProps": {
    "location": "Town Hall Ashburn",
    "description": "We need to start taking action, to make a difference and make life better."
  }
}
